import React from "react";
import styled from "styled-components";
import { Button } from "../components/Button";
import { NavLink } from "react-router-dom";
function Contact() {
  return (
    <>
      <Wrapper>
        <div className="contact_form_portion">
          <h3>contact form</h3>
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d110204.08182051395!2d77.97500897638945!3d30.326000442305173!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3908d7cbdc6e9d1b%3A0x7082f9fac370bdb7!2sPacific%20Mall%20Dehradun!5e0!3m2!1sen!2sin!4v1667299760808!5m2!1sen!2sin"
            width="100%"
            height="400"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>

         <div className="container">
         <div className="contact_form">
          <input type="text"
           name="username"
           placeholder="Enter your Name"
           autocomplete="off"
           required
          />
          <input type="email"
           name="Email"
           placeholder="Enter your Email"
           autocomplete="off"
           required
          />
          <textarea name="Message"
          cols="30"
          rows="10"
           placeholder="Enter your Message"
           autocomplete="off"
           required
          />
          <NavLink
              to="/login"
              className="navbar-link "
              onClick={() => setMenuIcon(false)}>
           <Button className="login_btn">LOGIN</Button>
            </NavLink>
         </div>
         </div>
        </div>
      </Wrapper>
    </>
  );
}
const Wrapper = styled.section`
  padding: 5rem 0;

  .contact_form_portion {
    width: 100%;
    h3 {
      text-align: center;
      text-transform: capitalize;
      font-size: 2.4rem;
      color: ${({ theme }) => theme.colors.text};
      margin: 3rem 0;
      font-weight: 550;
    }
    .contact_form{
      text-align:center;
    }
  }
`;
export default Contact;
